import React from 'react';

export function ContactForm({
    nameInput,
    setNameInput,
    phoneInput,
    setPhoneInput,
    emailInput,
    setEmailInput,
    handleSubmit
}) {
    return (
    <div>
        <form>
            <input type='text' placeholder='Enter name'></input>
            <input type='tel'></input>
            <input type='email'></input>
            <input type='submit'></input>
        </form>
    </div>)
}
